"use strict";const navToggle=document.querySelector("#mobile-navigation-button"),nav=document.querySelector("#primary-navigation"),overlay=document.querySelector(".overlay"),html=document.documentElement;navToggle.addEventListener("click",()=>{let e=nav.getAttribute("aria-expanded");"true"===e?(nav.setAttribute("aria-expanded","false"),navToggle.setAttribute("data-expanded","false"),overlay.classList.remove("overlay-visible"),html.classList.remove("scroll-lock")):(nav.setAttribute("aria-expanded","true"),navToggle.setAttribute("data-expanded","true"),overlay.classList.add("overlay-visible"),html.classList.add("scroll-lock"))});